import '../styles/colorComponent.css';

export class ListOfAddedColor extends Component {
  render() {
    return this.props.listOFColor.map((data) => (
      <div key={data.id} className="main_color" style={{ backgroundColor: data.name }} onClick={this.props.onDeleteColor.bind(this, data)}>
      <p>{data.name}</p>
      <span>X</span>
      </div>
    ))

  }
}
